package org.connect.model.user;

import com.fasterxml.jackson.annotation.JsonFormat;
import com.fasterxml.jackson.annotation.JsonIgnoreProperties;
import io.quarkus.security.identity.SecurityIdentity;
import org.connect.model.chat.Room;
import org.connect.model.skin.Skin;
import org.eclipse.microprofile.jwt.JsonWebToken;

import javax.persistence.*;
import java.io.Serializable;
import java.nio.charset.StandardCharsets;
import java.security.Principal;
import java.time.LocalDate;
import java.time.LocalDateTime;
import java.util.*;
import java.util.concurrent.ConcurrentHashMap;

@Entity
@JsonIgnoreProperties({"hibernateLazyInitializer","handler","rooms"})
@NamedQueries({
        @NamedQuery(name = User.FINDWITHID, query = "SELECT u FROM User u where u.id = :user_id"),
        @NamedQuery(name = User.FINDOTHERUSER, query = "SELECT u FROM User u join u.rooms r where r.id = :roomid AND r.type = 'DM' AND u.id NOT LIKE :user_id")
})
public class User implements Serializable {

    public static final String FINDWITHID = "User.findwithid";
    public static final String FINDOTHERUSER = "User.findotheruser";

    //Attribute
    @Id
    private String id;
    //private String userName;
    //private String firstname;
    //private String lastname;

    private char gender;
    private boolean hideLocation;
    private boolean blockConnect;

    @ElementCollection(fetch = FetchType.EAGER)
    @CollectionTable(name = "user_position_mapping",
            joinColumns = {@JoinColumn(name = "user_id", referencedColumnName = "id")})
    @MapKeyColumn(name = "latlng")
    @Column(name = "degrees")
    Map<String,Double> position = new HashMap<>();

    // Boolean to detect if the User has finished the Tutorial
    private int tutorialStage;

    //private LocalDateTime created;
    //LocalDateTime updated;
    private String description;
    //private String email;
    @JsonFormat(pattern = "yyyy-MM-dd")
    private LocalDate birthday;
    @Lob
    private byte[] profilePicture;

    @ManyToMany(mappedBy = "users")
    private List<Room> rooms = new LinkedList<>();

    public User() {
    }

    public User(String id, String userName) {
        this.id = id;
        this.profilePicture = "".getBytes();

        //this.userName = userName;
    }

    public User(SecurityIdentity identity) {
        //this.userName = identity.getPrincipal().getName();
        //this.attributes = identity.getPrincipal().toString();
        ////DEBUGSystem.out.println(attributes);
    }

    public User(JsonWebToken token) {
        this.id = token.claim("sub").get().toString();
        //this.userName = token.getName();
       // //DEBUGSystem.out.println(token.claim("name").get().toString());
        //this.firstname = token.claim("given_name").get().toString();
        //this.lastname = token.claim("family_name").get().toString();
        //this.email = token.claim("email").get().toString();
        this.gender = 'a';
        this.tutorialStage = 0;
        this.profilePicture = "".getBytes();
        //this.attributes = token.getRawToken();
        //DEBUGSystem.out.println(this.id);
    }


    public String getId() {
        return id;
    }

    public void setId(String id) {
        this.id = id;
    }

    public Map<String, Double> getPosition() {
        return position;
    }

    public void setPosition(Map<String, Double> position) {
        this.position = position;
    }

    public List<Room> getRooms() {
        return rooms;
    }

    public void setRooms(List<Room> rooms) {
        this.rooms = rooms;
    }

    public String getDescription() {
        return description;
    }

    public void setDescription(String description) {
        this.description = description;
    }

    public LocalDate getBirthday() {
        return birthday;
    }

    public void setBirthday(LocalDate birthday) {
        this.birthday = birthday;
    }

    public char getGender() {
        return gender;
    }

    public void setGender(char gender) {
        this.gender = gender;
    }

    public byte[] getProfilePicture() {
        return profilePicture;
    }

    public void setProfilePicture(byte[] profilePicture) {
        this.profilePicture = profilePicture;
    }

    public boolean isHideLocation() {
        return hideLocation;
    }

    public void setHideLocation(boolean hideLocation) {
        this.hideLocation = hideLocation;
    }

    public boolean isBlockConnect() {
        return blockConnect;
    }

    public void setBlockConnect(boolean blockConnect) {
        this.blockConnect = blockConnect;
    }

    public int getTutorialStage() { return tutorialStage; }

    public void setTutorialStage(int tutorialStage) { this.tutorialStage = tutorialStage; }

    @Override
    public String toString() {
        return "User{" +
                "id='" + id + '\'' +
                ", gender=" + gender +
                ", position=" + position +
                ", description='" + description + '\'' +
                ", birthday=" + birthday +
                ", rooms=" + rooms +
                ", tutorial=" + tutorialStage +
                ", blockConnect=" + blockConnect +
                ", hideLocation=" + hideLocation +
                '}';
    }

}
